import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import '../css/home.css'

export default class AdminHome extends Component {
    render() {
        return (
            <div>
            <h1>Admin HomePage</h1>
            <div className="container h-100"> 
              <div className="position-relative h-100"> 
           
                  <div className="position-relative top-center"> 
                      <button  type="button" className="btn btn-primary custom">Add a new User</button> 
                  </div> 
                  <div class="position-relative mid-center"> 
                      <button  type="button" className="btn btn-primary custom">Change Password</button> 
                  </div> 
          
          
                  <div className="position-relative bottom-center"> 
                      <button type="button" className="btn btn-primary custom">Add Prescription</button> 
                  </div> 
          
              </div> 
          </div> 
            </div>
        )
    }
}
